import React from "react";
import { HeaderButton } from "./components/HeaderButton.tsx";
import { TitlePage } from "./components/TitlePage.tsx";
import { OpenDeals } from "./components/OpenDeals.tsx";
import { Header } from "./components/Header.tsx";
function App() {
  return (
    <div className="font-serif">
      <div className="wrapper">
        <header >
          <HeaderButton className="text-gold border border-gold">Log In</HeaderButton>
          <HeaderButton className="bg-gold mr-[80px]">Sign Up</HeaderButton>
        </header>
        <main>
          <TitlePage />
          <OpenDeals />
        </main>
      </div>
    </div>
  );
}

export default App;
